SchedulerBasicP implements the default TinyOS scheduler sequence, as
documented in TEP 106.

@author Philip Levis
@author Cory Sharp
@date   January 19 2005

The TinyOS scheduler. It provides two interfaces: Scheduler,
for TinyOS to initialize and run tasks, and TaskBasic, the simplext
class of TinyOS tasks (reserved always at-most-once posting,
FIFO, parameter-free). For details and information on how to
replace the scheduler, refer to TEP 106.

@author  Phil Levis
@date    August 7 2005
@see     TEP 106: Tasks and Schedulers

Implementation of TEP 112 (Microcontroller Power Management) for
the MSP430. Code for low power calculation copied from older
msp430hardware.h by Vlado Handziski, Joe Polastre, and Cory Sharp.

Uses TI defines to identify which USCI resources are present.
Locate these by searching for __MSP430_HAS_ in the toolchain
header files in msp430/include.

This pass-through configuration allows us to wire other things directly into 
McuSleep at a later time, without breaking architecture to do so.

@author Philip Levis
@author Vlado Handziski
@author Joe Polastre
@author Cory Sharp
@author Peter A. Bigot <pab@peoplepowerco.com>
@author Eric B. Decker <cire831@gmail.com>

Implementation of TEP 112 (Microcontroller Power Management) for
the MSP430. Code for low power calculation copied from older
msp430hardware.h by Vlado Handziski, Joe Polastre, and Cory Sharp.

Uses TI defines to identify which USCI resources are present.
Locate these by searching for HAS_T in the TI Code Composer Studio
header files in ccsv4/msp430/include.  MSPGCC and IAR should match
these definitions.

@author Philip Levis
@author Vlado Handziski
@author Joe Polastre
@author Cory Sharp
@author Peter A. Bigot <pab@peoplepowerco.com>
@author Eric B. Decker <cire831@gmail.com>

Interface to allow high-level components to set a lower bound for a
microcontroller's low power state. This is sometimes necessary,
e.g., if a very low power state has a long wakeup latency that will
violate application timing requirements. TEP 112 describes how
TinyOS incorporates this information when the Scheduler tells
the MCU to enter a low power state.

@author Philip Levis
@date   Oct 26, 2005
@see    TEP 112: Microconroller Power Management

Microcontroller Sleep Events allows other components in the system
to perform actions when the microcontroller is thinking about going to 
sleep, going to sleep, or waking up.

@author David Moss
@author Peter Bigot

Interface to instruct the MCU to enter a low power state. TEP112
describes how an MCU computes this state and how the Scheduler uses
this interface to manage system power draw.

@author Philip Levis
@author Martin Turon <mturon@xbow.com>
@date   Oct 26, 2005

Interface to instruct TinyOS that the low-power state of the MCU
may have changed. TEP 112 describes how an MCU computes this state
and how the Scheduler uses this interface to manage system power
draw.

@author Philip Levis
@date   Oct 26, 2005
@see    TEP 112: Microcontroller Power Management


The interface to a TinyOS task scheduler.

@author Philip Levis
@date   January 19 2005
@see TEP 106: Tasks and Schedulers
@see TEP 107: Boot Sequence


Run the next task if one is waiting, otherwise return immediately. 

@return        whether a task was run -- TRUE indicates a task
               ran, FALSE indicates there was no task to run.
